import React, { Component } from "react";
import { InfoConsumer } from "../Info";

class Details extends Component {
  render() {
    return (
      <InfoConsumer>
        {data => {
          const {
            from,
            headerTitle,
            headerSubTitle,
            headerText,
            img,
            title,
            maps,
            description
          } = data.detailInfo;
        }}
      </InfoConsumer>
    );
  }
}

export default Details;
